import { Card, Divider, Table, Space } from 'antd'
import React, { Component } from 'react'
import UserHead from '../../../components/UserHead';
import { createFromIconfontCN } from '@ant-design/icons';
import './OrderTicket.css'

const IconFont = createFromIconfontCN({
    scriptUrl: '//at.alicdn.com/t/font_2779508_swd7x8t93re.js',
})
export default class OrderTicket extends Component {
    render() {

        const columns = [
            {
                title: '编号',
                dataIndex: 'carriageNumber',
                key: '1',
                align: 'center',
            },
            {
                title: '级别',
                dataIndex: 'level',
                key: '2',
                align: 'center',
            },
            {
                title: '规格',
                dataIndex: 'size',
                key: '3',
                align: 'center',
            },
            {
                title: '座位数',
                key: '4',
                dataIndex: 'seatNumber',
                align: 'center',
            },
            {
                title: '价格基数',
                key: '5',
                dataIndex: 'priceBase',
                align: 'center',
            },
            {
                title: '适配车型',
                key: '6',
                dataIndex: 'adapter',
                align: 'center',
            },
            {
                title: '操作',
                key: '7',
                render: () => (

                    <IconFont type="anticonicon--shanchu" />

                ),
                align: 'center'
            },
        ];

        const data = [
            {
                key: '1',
                carriageNumber: '001',
                level: '豪华',
                size: '(4+4)*10',
                seatNumber: '20',
                priceBase: '8',
                adapter: '动车',
            },
        ]

        return (
            <div>
                <UserHead />
                <div className="order-trian-info">
                    <Card
                        title="列车信息"
                        headStyle={{ backgroundColor: '#3B99FC' }}
                        bodyStyle={{ backgroundColor: '#EEF1F8' }}
                    >
                        车次 G2121
                    </Card>
                </div>
                <div className="order-passenger-info">
                    <Card
                        title="乘客信息"
                        headStyle={{ backgroundColor: '#3B99FC' }}
                        bodyStyle={{ backgroundColor: '#FFFFFF' }}
                    >
                        乘车人
                        张三 李四
                        <Divider dashed />
                        <Table
                            columns={columns}
                            dataSource={data}
                            bordered
                            rowKey="key"
                            pagination={false}
                        />
                    </Card>
                </div>
            </div>
        )
    }
}
